It's easier to explain with an example, so I will go with that. Say we have the following C code: // We declare these so the code can compile. Can go into a separate library file.
int AddMoney(int);
void LoadScript(int);
void PlayScript(); // The function we're writing.
void funFunction1() { int v1 = AddMoney(3000); if (v1) { LoadScript(12); PlayScript(); } for (int i = 0; i < 99; ++i) { int v2 = AddMoney(i); } //...
} Our compiler will take our C code and turn it into Assembly. How, you might be asking yourself? I will give you a high level idea of what is going on. See, when we do an operation in C, the operation we do has a corresponding set of Assembly. By parsing the C file, the compiler can match each operation in our C source code to a list of Assembly instructions that are functionally equivalent. This yields an intermediate Assembly file, which pertains to the architecture of the system we are compiling the binary for. In this case, it would yield ARMv5T Assembly (unless otherwise specified), which is the Assembly variant used on the Nintendo DS. In the case of our file, it would turn it into the following assembly (courtesy of gcc): funFunction1: push {r7, lr} sub sp, sp, #16 add r7, sp, #0 movw r0, #3000 bl AddMoney str r0, [r7, #8] ldr r3, [r7, #8] cmp r3, #0 beq .L2 movs r0, #12 bl LoadScript bl PlayScript
.L2: movs r3, #0 str r3, [r7, #12] b .L3
.L4: ldr r0, [r7, #12] bl AddMoney str r0, [r7, #4] ldr r3, [r7, #12] adds r3, r3, #1 str r3, [r7, #12]
.L3: ldr r3, [r7, #12] cmp r3, #98 ble .L4 nop nop adds r7, r7, #16 mov sp, r7 pop {r7, pc} This code is functionally equivalent to the code we wrote, but might be harder to understand at first glance.

